import "./progress.css";
const ProgressBar = () => {
  return (
    <div>
      <svg
        width={circlewidth}
        height={circlewidth}
        viewBox={`0 0 ${circlewidth} ${circlewidth}`}
      >
        <circle
          cx={circlewidth / 2}
          cy={circlewidth / 2}
          strokeWidth="15px"
          r={radius}
        />
      </svg>
    </div>
  );
};

export default ProgressBar;
